import React from 'react';
import {useHistory} from "react-router-dom"
import { useEffect, axios} from 'react';



export const TripDetails = () => {
  useProtectedPage();

  useEffect(() => {
    const token = localStorage.getItem("token");
    axios
      .get(
        "https://us-central1-labenu-apis.cloudfunctions.net/labeX/mayra-carver/trip/3bUbdB1gvPzWrThpazVC",
        {
          headers: {
            auth: token
          }
        }
      )
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.log("Deu erro: ", error.response);
      });
  }, []);
};

export const TripDetailsPage = () => {
  const history = useHistory()

  const goToApplicationFormPage = () => {
    history.push("/admin/trips/list")
  }
  
  return (
    <div>
    <p>Detalhe de uma viagem </p>
    <button onClick={goToApplicationFormPage}>Voltar</button>

    </div>
  );
}
